import { createTheme } from "@mui/material";

export const defaultTheme = createTheme({
  breakpoints: {
    values: {
      xs: 426,
      sm: 769,
      md: 1025,
      lg: 1441,
      xl: 1636,
    },
  },
  palette: {
    divider: "black",
    primary: {
      main: "#468189",
    },
    secondary: {
      main: "#77ACA2",
      light: "#9DBEBB",
      dark: "#031926",
      contrastText: "#F4E9CD",
    },
    text: {
      primary: "#000000",
      secondary: "#565144",
      light: "#888888",
    },
  },

  mixins: {
    toolbar: {
      minHeight: "inherit",
    },
  },

  typography: {
    fontFamily: "Nunito",
    lineHeight: 1.4,
    h2: {
      fontWeight: 700,
      fontSize: "2.25rem",
      lineHeight: 1.4,
    },
    h5: {
      fontWeight: 600,
      lineHeight: 1.4,
    },
    subtitle1: {
      fontSize: "1.125rem",
      lineHeight: 1.4,
    },
    body1: {
      lineHeight: 1.4,
    },
    body2: {
      fontSize: "1.25rem",
      lineHeight: 1.4,
    },
    subtitle2: {
      fontWeight: 600,
      lineHeight: 1.4,
    },
  },

  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          fontWeight: "700",
          fontSize: "1rem",
          boxShadow: "0px 5px 25px rgba(70, 129, 137, 0.3)",
          borderRadius: "25px",
          textTransform: "capitalize",
          padding: 0,
          width: 273,
          height: 50,
          background: "#6CA994",
        },
      },
    },
  },
});
